import React, { Component } from "react";
import { Nav } from "react-bootstrap";
import { withRouter } from "react-router";
import SideMenuElement from "../components/SideMenuElement";
import { SIDE_MENU } from "../constants/side-menu";
import "../style/Dashboard.css";
import PropTypes from "prop-types";
import { connect } from "react-redux";

class SideMenu extends Component {
  constructor(props) {
    super(props);

    this.onSelectHandler = this.onSelectHandler.bind(this);
  }

  onSelectHandler(key) {
    this.props.onSideMenuSelect(key);
  }

  render() {
    const elements = SIDE_MENU;

    return (
      <Nav
        className="sidebar"
        activeKey="/home"
        onSelect={(key) => this.onSelectHandler(key)}
      >
        {elements.map((element) => (
          <SideMenuElement
            key={element.id}
            component={element.component}
            componentName={element.name}
            componentIcon={element.icon}
          ></SideMenuElement>
        ))}
      </Nav>
    );
  }
}

SideMenu.propTypes = {
  dashboard: PropTypes.object,
};

const mapStateToProps = (state) => ({
  dashboard: state.dashboard,
});

SideMenu = withRouter(SideMenu);
export default connect(mapStateToProps)(SideMenu);
